// ARM SysTick period interrupts
// Input: interrupts every 12.5ns*period
//        priority is 0 (highest) to 3 (lowest)
void Sound_Init(uint32_t period, uint32_t priority){

  
  SysTick->CTRL  = 0x00;      // disable SysTick during setup

  SysTick->LOAD = period - 1; // set reload value for SysTick period

  SysTick->VAL = 0;           // any write to current clears it

  SCB->SHP[1] = (SCB->SHP[1]&(~0xC0000000)||(priority<<30));  // set priority = 0 (bits 31,30)

  SysTick->CTRL = 0x00000007; // enable with core clock and interrupts

  __enable_irq();             // normally we set I=0 in the main
  
  
}

void Sound_Stop(void){
  // either set LOAD to 0 or clear bit 1 in CTRL
    SysTick->LOAD = 0x00; // Disable SysTick timer

  
}


void Sound_Start(uint32_t period){
    // Set the reload value for the specified period
    SysTick->LOAD = period - 1;
    
    // Clear the current value register to force reload
    SysTick->VAL = 0;
    
    // Enable SysTick with core clock and interrupts
    SysTick->CTRL |= 0x07; // Enable, use system clock, enable interrupt
}

