void SysTick_Handler(void) {
    
    if (explosionPlaying) {
        DAC5_Out(explosion[explosionIndex]); // Output explosion sound sample
        explosionIndex++;

        if (explosionIndex >= EXPLOSION_LENGTH) {
            Explosion_Stop(); // Stop playing explosion after it finishes
        }
    } 
    else if (iceballPlaying) {
        DAC5_Out(iceball[iceballIndex]); // Output iceball sound sample
        iceballIndex++;

        if (iceballIndex >= ICEBALL_LENGTH) {
            Iceball_Stop(); // Stop playing iceball after it finishes
        }
    } 
    else if (slimeballPlaying) {
        DAC5_Out(slimeball[slimeballIndex]); // Output slimeball sound sample
        slimeballIndex++;

        if (slimeballIndex >= SLIMEBALL_LENGTH) {
            Slimeball_Stop(); // Stop playing slimeball after it finishes
        }
    } 
    else if (shootPlaying) {
        DAC5_Out(shoot[shootIndex]); // Output shoot sound sample
        shootIndex++;

        if (shootIndex >= SHOOT_LENGTH) {
            Shoot_Stop(); // Stop playing shoot after it finishes
        }
    } 
    else {
        // Default to sine wave if no sound effect is playing
        DAC5_Out(sinewave[index]);
        index = (index + 1) % 32;
        
        soundCounter++;
        if(soundCounter >= (2<<10)){
            soundCounter = 0;
            Sound_Stop();
        }


        

        
    }
}



